import React, { Component } from "react";
import "./App.css";
import Header from "./components/Header";
import Admin from "./components/Admin";
import Card from "./components/Card";
import withFirebase from "./hoc/withFirebase";

const App = props => {
  const cards = Object.keys(this.props.recettes).map(key => (
    <Card key={key} details={this.props.recettes[key]} />
  ));

  return (
    <div className="box">
      <Header pseudo={props.match.params.pseudo} />
      <div className="cards">{cards}</div>
      <Admin
        pseudo={props.match.params.pseudo}
        recettes={this.props.recettes}
        ajouterRecette={this.props.ajouterRecette}
        majRecette={this.props.majRecette}
        chargerExemple={this.props.chargerExemple}
        supprimerRecette={this.props.supprimerRecette}
      />
    </div>
  );
};

const WrappedComponent = withFirebase(App);

export default WrappedComponent;
